### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Functions and Their Properties**
- **Differentiability and Continuity**:
  - A function \( f(x) \) is differentiable at a point if the derivative exists at that point.
  - A function \( f(x) \) is continuous at a point if the limit of the function as \( x \) approaches that point is equal to the function value at that point.
  - Example: \( f(x) = a \sin|x| + b e^{|x|} \) is differentiable at \( x = 0 \) if and only if \( a + b = 0 \).

- **One-to-One Functions**:
  - A function is one-to-one (injective) if different inputs give different outputs.
  - Examples: \( f(x) = -5x - 1 \) and \( f(x) = \log_{5x} \) are one-to-one functions.

#### 2. **Limits and Their Evaluation**
- **Limit Theorems**:
  - \(\lim_{x \to a} [f(x) + g(x)] = \lim_{x \to a} f(x) + \lim_{x \to a} g(x)\)
  - \(\lim_{x \to a} [f(x) \cdot g(x)] = \lim_{x \to a} f(x) \cdot \lim_{x \to a} g(x)\)
  - \(\lim_{x \to a} \frac{f(x)}{g(x)} = \frac{\lim_{x \to a} f(x)}{\lim_{x \to a} g(x)}\), provided \(\lim_{x \to a} g(x) \neq 0\)

- **Examples**:
  - \(\lim_{x \to 0} \left( \frac{(1 + x)^{\frac{1}{x}} - (1 - x)^{\frac{1}{x}}}{x} \right) = 2\)
  - \(\lim_{x \to \infty} \frac{(10x - 1)(x + 3)(x + 2)(x + 1)x}{(5x - 1)(x + 9)(x + 4)(x + 8)x} = 2\)

#### 3. **Sequences and Their Limits**
- **Limit of Sequences**:
  - For a sequence \( \{a_n\} \), the limit as \( n \to \infty \) is the value that \( a_n \) approaches as \( n \) becomes very large.
  - Example: \( a_n = \frac{27n^7 + 25n^5 + 2n^8 + n}{4n^2 + 2n + 10n^3 + 5n^4 + n} \), the limit is \( \infty \).

- **Exponential Sequences**:
  - For a sequence \( \{b_n\} = 2^{5a_n} \), the limit can be found using the limit of \( \{a_n\} \).
  - Example: \( b_n = 2^{5a_n} \), where \( a_n \) is as above, the limit is \( \infty \).

#### 4. **Logarithmic and Exponential Equations**
- **Solving Logarithmic Equations**:
  - Use properties of logarithms to simplify and solve equations.
  - Example: \( \log_2(x+1) - \log_4(x-3) = 2 \) has a solution \( x = 7 \).

- **Solving Exponential Equations**:
  - Rewrite the equation in terms of a common base or use logarithms.
  - Example: \( e^{2x} - 9e^x = -18 \) has solutions \( x = \ln(6) \) and \( x = \ln(3) \).

#### 5. **Function Composition and Domain**
- **Domain of Composite Functions**:
  - The domain of \( g \circ f \) is the set of all \( x \) such that \( x \) is in the domain of \( f \) and \( f(x) \) is in the domain of \( g \).
  - Example: For \( f(x) = \sqrt{x+5} \) and \( g(x) = x^2 - 5 \), the domain of \( g \circ f \) is \([-1, \infty)\).

- **Evaluating Composite Functions**:
  - Example: \( (g \circ f \circ g \circ f)(2) = 2 \).

#### 6. **Differentiability and Non-Differentiable Points**
- **Non-Differentiable Points**:
  - Points where the function is not differentiable, such as cusps or vertical tangents.
  - Example: The function \( f(x) = x\sqrt{25 - x^2} \) has 2 points where \( |f(x)^2| \) is not differentiable.

